import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route, Routes } from 'react-router-dom';
import Shuffle from './pages/Shuffle';

const App = () => {

  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Shuffle/>}/>
      </Routes>
    </div>
  );
};

export default App;
